('2421','18','7931','Villa Heinemann Calvia',Null,'Schmucke Villa mit Panoramablick in Calvin zu verkaufen','33993','Die sehr schöne moderne Villa befindet sich im Kern vom begehrten Calvin. Die Villa ist eine Wohlfuehloase mitten im Dorf, ausgestattet mit modernster Technik wie Soundsystem in allen Räumen wie auch entspannendes LED Licht. Für das Haus wurde nur beste Qualität verwendet wie Holzfenster Doppelverglasung mit elektrischen Rollläden der Fussboden aus sehr hochwertigem Marmor „Antigua“, auch die Küche „Miele“ lässt keine Wünsche offen. Die Wohnfläche von 190m2 erstreckt sich über drei Stockwerke, im Erdgeschoss befindet sich der Großzügige Wohn-Esszimmerbereich mit einer Raumhöhe von 6m sowie der erwähnten Wohnküche, das Master Schlafzimmer mit Bad Toilette findet man ebenfalls im Erdgeschoss, Das Obergeschoss umfasst zwei weitere Schlafzimmer eines mit Sonnentrasse und ein Bad. Im Untergeschoss befinden sich neben separat zugänglichem Gästeapartment ein weiterer Raum für Sauna und Wellness. Erholen kann man sich im sehr schön angelegten Garten sowie dem entspannenden Polobereich mit überdachter Terrasse. Des weiteren verfügt das Haus über Bodenheizung verbaute Zentralklimaanlage, Wasseraufbereitungsanlage sowie Wärmepumpe. ','33994','1100000','106','2016-01-27 12:25:15','106','2016-01-27 12:25:51',Null,'2555','78','1199',1,'1','0',Null,Null,'Preis auf Anfrage','33995',Null,'0','0','0',Null,'2016-01-27 12:31:11',1,'0',Null,Null,Null,Null,'5',1,1,1,'0','1','1',1,1,Null,'33996',Null,'33997',Null,'33998',Null,'33999',Null,'34000','0',0,'0');
